        settings: null,
        isLoadingList: false,
    }

    render() {
        return (
            <Row className="main">
                <Col
                    className="left-side"
                    span = {8}
                >
                    <SatSetting />
                    <SatelliteList />
                </Col>
                <Col
                    className="right-side"
                    span = {16}
                >
                    right
